 def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

for num in range(20, 41):
    square = int(num ** 0.5) + 1
    if num == square * square and not is_prime(num):
        print("The number you are looking for is:", num)
